//https://reacttraining.com/react-router/web/example/basic
import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, /*Link,*/ NavLink } from "react-router-dom";
import Solution from './Solution';
import Home from './Home';
import Cartoonizer from './Cartoonizer';
import Birthday from './Birthday';
import Contact from './Contact';
import Header from './Header';
import {ThemeContext, themes} from './theme-context';


class App extends Component {
  render() {
    return (
       <ThemeContext.Provider value={themes.en}>
          <Header>
          </Header> 
       <Router>
         <div className="container">
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
             <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsibleNavbar">
             <span className="navbar-toggler-icon"></span>
             </button>
        <div className="navbar-collapse collapse" id="collapsibleNavbar">
        <div className="navbarNav">
        <ul className="spisokNav">
          <li className="navItem">
            <NavLink  exact={true} to="/frontend" className="navLink">Home</NavLink>
          </li>
          <li className="navItem">
            <NavLink to="/frontend/solution" className="navLink">Solution for Blind People</NavLink>
          </li>
          <li className="navItem">
            <NavLink to="/frontend/birthday" className="navLink">Birthday Present</NavLink>
          </li>
          <li className="navItem">
            <NavLink to="/frontend/cartoonizer" className="navLink">Cartoonizer</NavLink>
          </li>
          <li className="navItem">
            <NavLink to="/frontend/contact" className="navLink">Contact Us</NavLink>
          </li>
        </ul>
        <Route exact path="/" component={Home} />
        <Route exact path="/frontend" component={Home} />
        <Route exact path="/frontend/solution" component={Solution} />
        <Route exact path="/frontend/birthday" component={Birthday} />
        <Route exact path="/frontend/cartoonizer" component={Cartoonizer} />
        <Route exact path="/frontend/contact" component={Contact} />
        <Route exact path="/frontend/header" component={Header} />
        </div>
        </div>
        </nav>
        <p></p>
        </div>
    </Router>
    </ThemeContext.Provider>
    );
  }
}

export default App;
